import React from 'react';
import { Link } from 'react-router-dom';
import './Sidenav.css'; // Import your CSS file for styles

function Sidenav() {
  return (
    <div className='side'>
      <div className='tvc'>
        <Link to={'/tv'}>TV</Link><br />
        <Link to={'/headphone'}>Headphones</Link><br />
        <Link to={'/speakers'}>Speakers</Link><br />
      </div>
    </div>
  );
}

export default Sidenav;
